CREATE TABLE Region 
( 
  RegionID NUMBER(10) NOT NULL, 
  RegionDescription CHAR(50) NOT NULL, 
CONSTRAINT PK_Region 
  PRIMARY KEY (RegionID)
) 
/ 

CREATE TABLE Territories 
( 
  TerritoryID NVARCHAR2(20) NOT NULL, 
  TerritoryDescription CHAR(50) NOT NULL, 
  RegionID NUMBER(10) NOT NULL, 
CONSTRAINT PK_Territories 
  PRIMARY KEY (TerritoryID), 
CONSTRAINT FK_Territories_Region FOREIGN KEY (RegionID) REFERENCES Region(RegionID)
) 
/ 

CREATE TABLE Categories 
( 
  CategoryID NUMBER(10) NOT NULL, 
  CategoryName NVARCHAR2(15) NOT NULL, 
  Description NCLOB, 
  Picture LONG RAW, 
CONSTRAINT PK_Categories 
  PRIMARY KEY (CategoryID)
) 
/ 

CREATE TABLE Suppliers 
( 
  SupplierID NUMBER(10) NOT NULL, 
  CompanyName NVARCHAR2(40) NOT NULL, 
  ContactName NVARCHAR2(30), 
  ContactTitle NVARCHAR2(30), 
  Address NVARCHAR2(60), 
  City NVARCHAR2(15), 
  Region NVARCHAR2(15), 
  PostalCode NVARCHAR2(10), 
  Country NVARCHAR2(15), 
  Phone NVARCHAR2(24), 
  Fax NVARCHAR2(24), 
  HomePage NVARCHAR2(200), 
CONSTRAINT PK_Suppliers 
  PRIMARY KEY (SupplierID)
) 
/ 

CREATE TABLE Products 
( 
  ProductID NUMBER(10) NOT NULL, 
  ProductName NVARCHAR2(40) NOT NULL, 
  SupplierID NUMBER(10), 
  CategoryID NUMBER(10), 
  QuantityPerUnit NVARCHAR2(20), 
  UnitPrice DECIMAL(19,4), 
  UnitsInStock NUMBER, 
  UnitsOnOrder NUMBER, 
  ReorderLevel NUMBER, 
  Discontinued NUMBER(1) NOT NULL, 
CONSTRAINT PK_Products 
  PRIMARY KEY (ProductID), 
CONSTRAINT CK_Products_UnitPrice  CHECK ((UnitPrice >= 0)), 
CONSTRAINT CK_ReorderLevel  CHECK ((ReorderLevel >= 0)), 
CONSTRAINT CK_UnitsInStock  CHECK ((UnitsInStock >= 0)), 
CONSTRAINT CK_UnitsOnOrder  CHECK ((UnitsOnOrder >= 0)), 
CONSTRAINT FK_Products_Categories FOREIGN KEY (CategoryID) REFERENCES Categories(CategoryID), 
CONSTRAINT FK_Products_Suppliers FOREIGN KEY (SupplierID) REFERENCES Suppliers(SupplierID)
) 
/ 

CREATE TABLE Shippers 
( 
  ShipperID NUMBER(10) NOT NULL, 
  CompanyName NVARCHAR2(40) NOT NULL, 
  Phone NVARCHAR2(24), 
CONSTRAINT PK_Shippers 
  PRIMARY KEY (ShipperID)
) 
/ 

CREATE TABLE Customers 
( 
  CustomerID CHAR(5) NOT NULL, 
  CompanyName NVARCHAR2(40) NOT NULL, 
  ContactName NVARCHAR2(30), 
  ContactTitle NVARCHAR2(30), 
  Address NVARCHAR2(60), 
  City NVARCHAR2(16), 
  Region NVARCHAR2(15), 
  PostalCode NVARCHAR2(10), 
  Country NVARCHAR2(15), 
  Phone NVARCHAR2(24), 
  Fax NVARCHAR2(24), 
CONSTRAINT PK_Customers 
  PRIMARY KEY (CustomerID)
) 
/ 

CREATE TABLE Employees 
( 
  EmployeeID NUMBER(10) NOT NULL, 
  LastName NVARCHAR2(20) NOT NULL, 
  FirstName NVARCHAR2(10) NOT NULL, 
  Title NVARCHAR2(30), 
  TitleOfCourtesy NVARCHAR2(25), 
  BirthDate DATE, 
  HireDate DATE, 
  Address NVARCHAR2(60), 
  City NVARCHAR2(15), 
  Region NVARCHAR2(15), 
  PostalCode NVARCHAR2(10), 
  Country NVARCHAR2(15), 
  HomePhone NVARCHAR2(24), 
  Extension NVARCHAR2(4), 
  Photo LONG RAW, 
  Notes NVARCHAR2(600), 
  ReportsTo INT, 
  PhotoPath NVARCHAR2(255), 
CONSTRAINT PK_Employees 
  PRIMARY KEY (EmployeeID), 
CONSTRAINT FK_Employees_Employees FOREIGN KEY (ReportsTo) REFERENCES Employees(EmployeeID)
) 
/ 

CREATE TABLE EmployeeTerritories 
( 
  EmployeeID NUMBER(10) NOT NULL, 
  TerritoryID NVARCHAR2(20) NOT NULL, 
CONSTRAINT PK_EmpTerritories 
  PRIMARY KEY (EmployeeID, TerritoryID), 
CONSTRAINT FK_EmpTerri_Employees FOREIGN KEY (EmployeeID) REFERENCES Employees(EmployeeID), 
CONSTRAINT FK_EmpTerri_Territories FOREIGN KEY (TerritoryID) REFERENCES Territories(TerritoryID)
) 
/ 

CREATE TABLE CustomerDemographics 
( 
  CustomerTypeID CHAR(10) NOT NULL, 
  CustomerDesc LONG, 
CONSTRAINT PK_CustomerDemographics 
  PRIMARY KEY (CustomerTypeID)
) 
/ 

CREATE TABLE CustomerCustomerDemo 
( 
  CustomerID CHAR(5) NOT NULL, 
  CustomerTypeID CHAR(10) NOT NULL, 
CONSTRAINT PK_CustomerDemo 
  PRIMARY KEY (CustomerID, CustomerTypeID), 
CONSTRAINT FK_CustomerDemo FOREIGN KEY (CustomerTypeID) REFERENCES CustomerDemographics(CustomerTypeID), 
CONSTRAINT FK_CustomerDemo_Customers FOREIGN KEY (CustomerID) REFERENCES Customers(CustomerID)
) 
/ 

CREATE TABLE Orders 
( 
  OrderID NUMBER(10) NOT NULL, 
  CustomerID CHAR(5), 
  EmployeeID NUMBER(10), 
  OrderDate TIMESTAMP, 
  RequiredDate DATE, 
  ShippedDate TIMESTAMP, 
  ShipVia NUMBER(10), 
  Freight DECIMAL(10,2), 
  ShipName NVARCHAR2(40), 
  ShipAddress NVARCHAR2(60), 
  ShipCity NVARCHAR2(15), 
  ShipRegion NVARCHAR2(15), 
  ShipPostalCode NVARCHAR2(10), 
  ShipCountry NVARCHAR2(15), 
CONSTRAINT PK_Orders 
  PRIMARY KEY (OrderID), 
CONSTRAINT FK_Orders_Customers FOREIGN KEY (CustomerID) REFERENCES Customers(CustomerID), 
CONSTRAINT FK_Orders_Employees FOREIGN KEY (EmployeeID) REFERENCES Employees(EmployeeID), 
CONSTRAINT FK_Orders_Shippers FOREIGN KEY (ShipVia) REFERENCES Shippers(ShipperID)
) 
/ 

CREATE TABLE OrderDetails 
( 
  OrderID NUMBER(10) NOT NULL, 
  ProductID NUMBER(10) NOT NULL, 
  UnitPrice DECIMAL(19,4) NOT NULL, 
  Quantity NUMBER NOT NULL, 
  Discount NUMBER NOT NULL, 
CONSTRAINT PK_Order_Details 
  PRIMARY KEY (OrderID, ProductID), 
CONSTRAINT CK_Discount  CHECK ((Discount >= 0 and Discount <= 1)), 
CONSTRAINT CK_Quantity  CHECK ((Quantity > 0)), 
CONSTRAINT CK_UnitPrice  CHECK ((UnitPrice >= 0)), 
CONSTRAINT FK_OrderDetails_Orders FOREIGN KEY (OrderID) REFERENCES Orders(OrderID), 
CONSTRAINT FK_OrderDetails_Products FOREIGN KEY (ProductID) REFERENCES Products(ProductID)
)
/

